import Head from 'next/head';

export default function Header() {
    return (
        <div>
            <Head>
               <link rel="shortcut icon" href="https://filmafinity.biz:443/assets/images/favicon.gif" />
               <script src="https://use.fontawesome.com/3db27005e3.js"></script>
               <link href="https://use.fontawesome.com/3db27005e3.css" media="all" rel="stylesheet" />
               <link rel="stylesheet" href="https://filmafinity.biz:443/themes/g-stream/css/v1.css" />
               <script src="https://filmafinity.biz:443/themes/g-stream/js/js.js"></script>
            </Head>
        </div>
    );
}
